INSERT INTO `essay` VALUES (92, 81, 36, 22, 1, 0, '金母博伙为乃格七子之祖。具体的谱系是：阿都尔普，尔普金母，金母博伙，博伙巴哈，巴哈沙争、沙争依乌、依乌依抵、依抵阿说、阿说乃格；\n乃格七子分别是（乃根普省、乃根拉普、乃根普自、乃根楚莫、乃根伟稳、乃根兹体、乃根萨几）(ꆂꈨꌺꏃꈤ：ꆂꈨꁌꌋ、ꆂꈨꆿꁌ、ꆂꈨꁮꋧ、ꆂꈨꍲꃀ、ꆂꈨꃤꊋ、ꆂꈨꌅꄚ、ꆂꈨꌐꏸ)\n一\n\n勒惹惹尼（两子）分别是【勒惹吉此、勒惹啊藏】；\n\n\n\n吉此惹所（三子）分别是【吉此阿史、吉此沙祖、吉此武以】\n\n\n\n金国惹所（三子）分别是【金果鲁颇、金果根书、金果根着】\n\n\n\n鲁颇惹尼（两子）分别是【鲁颇洛吉、鲁颇阿妞】\n\n\n\n根着惹乐（四子）分别是【根着兵根、根着仁伙、根着念那、根着散金】\n\n\n\n根书惹尼（两子）分别是【根书补尔、根书阿尔】\n\n\n\n沙祖惹尼（两子）分别是【沙祖约拼、沙祖阿体】\n\n\n\n武以惹尼（两子）分别是【武以鲁伙、武以金莫】\n\n\n\n啊藏惹尼（两子）分别是【啊藏海干、啊藏吉伙】；\n\n\n\n吉伙惹尼（两子）分别是【吉伙拉惹、吉伙金恩】；\n\n\n\n拉惹惹尼（两子）分别是【拉惹哦果、拉惹章博】\n\n\n\n金恩惹恩（五子）分别是【金恩依体、金恩日体、金恩永则、金恩鲁工、金恩惹乐】', '云南省丽江市古城区玉雪大道149号', 3, '2022-06-01 15:10:22', 0, 2592000, 1654934693, 1657526693, 0);
INSERT INTO `essay` VALUES (93, 81, 36, 25, 4, 2, '一是乃根朴省，成为尼木利利的先祖(ꆂꈨꁌꌋꌅꌋꆏꆀꃅꆹꀕ)，即罗罗宣慰司。\n二是乃根拉普(ꆂꈨꆿꁌ)。拉普三子（拉普升曲、拉普迪俄、拉普都诺）\n三是乃根补自，成为给补、双国等支的先祖。(ꆂꈨꁮꋧꆏꈾꁮ、ꎰꇩꐛ)\n四是乃根楚莫，成为哦尔、补典等支的先祖。(ꆂꈨꍲꃀꆏꀒꇖ、ꄅꐛ。\n五是乃根稳俄伟拉，成为诺都、陌生等支的先祖。(ꆂꈨꃤꊋꃨꆿꆏꆈꄖ、ꂽꌋꐛ)\n六是乃根兹体兹富，成为恩皆支系。(ꆂꈨꌅꄚꌅꃘꆏꆀꃅꉢꐞꐛ)\n七是乃根萨几萨涅，成为马海支系。(ꆂꈨꌐꏸꌒꑐꆏꆀꑴꂵꉌꐛ)；\n \n拉普三子（拉普升曲、拉普迪俄、拉普都诺）\n一是拉普升曲成为果基支的先祖(ꆿꁌꎸꐎꆏꈢꐯꁍꁌꐛ)。\n二是拉普迪俄，迪俄生四子 (ꆿꁌꄹꀑꌺꇖꈤ)：\n1迪武肯母克，是斯木补余支的先祖(ꄹꀑꈌꃅꆏꌦꃅꁮꒀꁍꁌꐛ)；\n2迪俄迪尼拉尼成为倮伍、倮母、热孔、巴且、竹尔等支的先祖(ꄹꀑꄶꅽꆿꅽꆏꇉꃶ、ꇉꃅ、ꁠꏼ、ꌭꈈ、ꍘꇐꁍꁌꐛ)；\n3迪俄永迪，成为万张、罗洪两支的先祖(ꄹꀑꑿꅓꆏꃪꍈ、ꇊꉼꁍꁌꐛ)；\n4迪俄约芝绝(ꄹꀑꒀꍝꈔ)。\n三是拉普都诺(ꆿꁌꅋꆌ)绝。\n备注：迪窝四子分别是【迪窝克姆——补余，（没有分支）；迪窝迪——', '云南省丽江市古城区玉雪大道149号', 3, '2022-06-01 15:15:29', 0, 2592000, 1655770786, 1658362786, 0);
