INSERT INTO `essay` VALUES (874, 55, 35, 5, 0, 0, '果基家族源于舍曲，所处的朝代约在民末清初，从舍曲开创果基家族，繁衍至今家族已到了16至19代范围，繁衍了约400年。\n400年来果基家族在西南一隅顽强生存繁衍，生生不息，不断壮大。\n诺合家族，起于木合始祖，所处朝代约在南宋时期，繁衍至今家族已到了31至34代范围，繁衍了约800年。\n夷族：\n阿普笃慕祖先，所处年代约是隋唐时期，繁衍至今已到了55至57代范围，繁衍了约约1400年。\n希慕遮祖先，所处年代约是秦末西汉时期，繁衍至今已到 88至91代范围，繁衍了约2250年。\n莫慕阿青祖先，所处年代约是夏朝时期，繁衍至今已到154至157代范围，繁衍了约3900年。', '澳门特别行政区', 3, '2022-07-03 18:11:24', 0, 2592000, 1656848302, 1659440302, 0);
